import React from "react";

function Table_flesh_child(props){
    console.log("Table_flesh_child");
    let style_flesh  = {display:"none"};
    let style_flesh2 = {display:"none"};
    let style_flesh3 = {display:"none"};
    let style_flesh4 = {display:"none"};

    return (
    <div className={`${props.child} d-flex justify-content-center align-items-center border-dark`}>
        <div  className={`rounded-circle border Boy ${style_flesh}`}></div>
        <div  className={`rounded-circle border Boy ${style_flesh2}`}></div>
        <div  className={`rounded-circle border Boy ${style_flesh3}`}></div>
        <div  className={`rounded-circle border Boy ${style_flesh4}`}></div>
    </div>
    )
}

export default Table_flesh_child;
